for(var navmenuDropdowns=document.querySelectorAll(".navmenu li > a:not(:only-child)"),i=0;i<navmenuDropdowns.length;i++){var toggle=navmenuDropdowns[i];toggle.addEventListener("click",function(){this.nextElementSibling.classList.toggle("hidden"),console.log("it works!")})}for(var navicons=document.querySelectorAll(".navicon"),i=0;i<navicons.length;i++){var toggle=navicons[i];toggle.addEventListener("click",function(){this.classList.toggle("active")})}